import React from 'react';

const CampaingnGrid = ({children, type= 'default'}) => {
    if(type !== "default") return 
    return (
        <div className='grid grid-cols-4 gap-x-7'>
            {children}
        </div>
    );
};

export default CampaingnGrid;
